import { connect } from 'react-redux'
import Detail from '../../page/Set/Class/Detail'
import {addClassMember} from '../../redux/actions/classSynopsis'

function a(state) {
  // console.log(state);
  return {
    classDetail: state.classDetail
  }
}
function b(dispatch) {
  return {
    addClassMember : (data) => { dispatch(classDetail(data)) }

  }
}

export default connect(a, b)(Detail)
